css:
* {
    color: #FFF !important;
    background-color: rgba(33, 150, 243, 0.59) !important;
}

div {
    outline: rgba(255, 255, 255, 0.2) 2px dashed !important;
    box-shadow: rgba(18, 44, 119, 0.2) -2em 2em 3em 0px;
    stroke-dasharray: 100;
}

p,span {
    outline: rgba(255, 255, 255, 0.2) 2px dotted !important;
    box-shadow: rgba(18, 44, 119, 0.1) -2em 2em 3em 0px;
    stroke-dasharray: 100;
}
